export const getAncientData = () => {
  const data = {};
  let transformed = DATA.split("\n");
  transformed.forEach((line) => {
    const clean = line.replace(/\"/gim, "").split(";");
    const uf = clean[5];
    const ano = clean[2];
    const turno = clean[3];
    const cargo = clean[8].toLocaleLowerCase().replace(/\s/gim, "_");
    const aptos = clean[9] * 1 || 0;
    const comparecimento = clean[9] * 1 || 0;
    const nominais = clean[12] * 1 || 0;
    const brancos = clean[13] * 1 || 0;
    const nulos = clean[14] * 1 || 0;
    const legenda = clean[15] * 1 || 0;
    const anulados = clean[16] * 1 || 0;
    const secoes = clean[17] * 1 || 0;
    const secoes_anuladas = clean[18] * 1 || 0;
    const id = `${uf}-${ano}-${turno}`;
    if (!data[id]) {
      data[id] = {
        resumo: {
          id,
          uf,
          ano,
          turno,
          secoes,
        },
        absolutos: {
          secoes_anuladas: 0,
          validos: 0,
          nulos: 0,
          brancos: 0,
        },
        cargos: {},
      };
    }
    data[id].absolutos.nominais += nominais * 1;
    data[id].absolutos.nulos += nulos * 1;
    data[id].absolutos.brancos += brancos * 1;

    data[id].cargos[`${cargo}`] = {
      nominais,
      brancos,
      nulos,
      legenda,
      anulados,
      secoes_anuladas,
      validos: nominais + legenda,
      total: nominais + nulos + brancos + legenda,
    };
  });
  const result = [];
  const keys = Object.keys(data);
  keys.forEach((key) => {
    result.push(data[key]);
  });
  return result;
};
